Welcome to another caliente edition of 

8thStreetLatinas! Today we bring you 

Abella. This chick was off the chain and 

very freaky my friends. When JMac stepped 

into the store she knew what time it was. 

She definitely liked what she saw and she 

was down for whatever. After a few trips 

to the fitting room and some indirect 

flirting tensions were pretty high. But 

expect a few ice-breakers from Tony to 

get things spicy. After a while Abella 

started getting more and more freakier 

and she was horny as hell! She offered to 

take of JMac and get in a skimpier dress 

to tease the eyes. When she was finished 

getting dressed she was smoking and with 

her little Spanish accent she was FIRE. 

What ensued cant even be described but 

definitely worthy of viewing! EnJoy!
